import React, { Component } from "react";
import "./SideBarComponent.scss";
class SideBarComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return <div>sidebar Works</div>;
  }
}

export default SideBarComponent;
